// SPDX-License-Identifier: MIT

pragma solidity >=0.7.0 <0.9.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "./DefaultOperatorFilterer.sol";

contract NFT0066FF is Ownable, DefaultOperatorFilterer, ERC721Enumerable {
    uint256 public maxSupply;
    uint256 public tokenIdCounter;
    uint256 public maxMint;
    uint256 public price = 0.01 ether;
    string private baseTokenURI;
    mapping(uint256 => address) private requestToSender;
        
    constructor(
        string memory baseURI_,
        uint256 maxSupply_,
        uint256 maxMint_
    ) ERC721("NFT0066FF","NFT0066FF") {
        maxSupply = maxSupply_;
        maxMint = maxMint_;
        baseTokenURI = baseURI_;
        mint(10);
    }

    function mint(uint256 quantity) public payable {
        if(msg.sender != owner()) {
            require(msg.value >= quantity*price, 'Not enough ETH');
        }
        require(quantity > 0, 'Amount has to be > 0');
        require(totalSupply() + quantity <= maxSupply, 'SOLD OUT');
        for (uint256 i = 0; i < quantity; i++) {
            requestToSender[totalSupply() + 1] = msg.sender;
            _safeMint(msg.sender, totalSupply() + 1);
        }
    }

    function baseURI() internal view returns (string memory) {
        return baseTokenURI;
    }

    function setbaseURI(string memory baseURI_) public onlyOwner {
        baseTokenURI= baseURI_;
    }

    function tokenURI(uint256 tokenId) public view virtual override(ERC721) returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");
        string memory tokenIdStr = Strings.toString(tokenId);
        return string(abi.encodePacked("ipfs://", baseTokenURI, "/", tokenIdStr, ".json"));
    }

    function withdraw() public payable onlyOwner {
        (bool os, ) = payable(owner()).call{value: address(this).balance}("");
        require(os, "Failed to withdraw");
    }

    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public override(ERC721, IERC721) onlyAllowedOperator(from) {
        super.transferFrom(from, to, tokenId);
    }

    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public override(ERC721, IERC721) onlyAllowedOperator(from) {
        super.safeTransferFrom(from, to, tokenId);
    }
}
